import React from 'react';
import { Layout as AntLayout } from 'antd'
import Header from './Header';

const Layout = props => {
    return (
        <AntLayout>
            <Header className="site-layout-background" style={{ padding: 0 }} />
            {props.children}
        </AntLayout>
    );
}

export default Layout;
